import Home from './pages/Home';
import About from './pages/Project';
import Contact from './pages/Contact';

const routes = [
  { path: '/', component: <Home />, exact: true },
  { path: '/about', component: <About /> },
  { path: '/contact', component: <Contact /> },
];

export default routes;
